import { Particle } from "./particle.js";

class App {
  constructor() {
    this.image = new Image();
    this.image.src =
      "data:image/png;base64,";

    this.canvas = document.createElement("canvas");
    this.ctx = this.canvas.getContext("2d");

    this.color = false;

    document.body.appendChild(this.canvas);

    window.addEventListener("mousedown", this.handleMouse.bind(this), false);
    window.addEventListener("mouseup", this.handleMouse.bind(this), false);
    window.addEventListener(
      "touchstart",
      this.handleTouchStart.bind(this),
      false
    );
    window.addEventListener("touchend", this.handleTouchEnd.bind(this), false);

    this.canvas.width = 550;
    this.canvas.height = 706;

    this.particlesArray = [];
    this.numberOfParticles = 7000;

    this.mappedImage = [];

    this.image.onload = () => {
      this.ctx.drawImage(
        this.image,
        0,
        0,
        this.canvas.width,
        this.canvas.height
      );

      this.pixels = this.ctx.getImageData(
        0,
        0,
        this.canvas.width,
        this.canvas.height
      );
      this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);

      for (let y = 0; y < this.canvas.height; y++) {
        let row = [];
        for (let x = 0; x < this.canvas.width; x++) {
          const red = this.pixels.data[y * 4 * this.pixels.width + x * 4];
          const green = this.pixels.data[y * 4 * this.pixels.width + x * 4 + 1];
          const blue = this.pixels.data[y * 4 * this.pixels.width + x * 4 + 2];
          const brightness = this.calculatedRelativeBrightness(
            red,
            green,
            blue
          );
          row.push([brightness, red, green, blue]);
        }
        this.mappedImage.push(row);
      }

      this.init();
      this.animate();
      window.requestAnimationFrame(this.animate.bind(this));
    };
  }

  init() {
    for (let i = 0; i < this.numberOfParticles; i++) {
      this.particlesArray.push(
        new Particle(
          this.ctx,
          this.canvas.width,
          this.canvas.height,
          this.mappedImage
        )
      );
    }
  }

  animate() {
    requestAnimationFrame(this.animate.bind(this));
    this.ctx.globalAlpha = 0.05;
    // this.ctx.drawImage(this.image, 0, 0, this.canvas.width, this.canvas.height);
    this.ctx.fillStyle = "rgb(0,0,0)";
    this.ctx.fillRect(0, 0, this.canvas.width, this.canvas.height);

    for (let i = 0; i < this.numberOfParticles; i++) {
      this.particlesArray[i].update();
      this.ctx.globalAlpha = this.particlesArray[i].speed * 0.5;
      this.particlesArray[i].draw(this.color);
    }
  }

  calculatedRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  handleMouse() {
    this.color = !this.color;
  }
  handleTouchStart() {
    this.color = true;
  }
  handleTouchEnd() {
    this.color = false;
  }
}

window.onload = () => {
  new App();
};
